Después de 15 años de silencio @chanelofficial lanza una nueva fragancia, #Gabrielle. Un mosaico de cuatro flores blancas que rescata el espíritu más rebelde y apasionado de #CocoChanel: "Elegí lo que quería ser y lo soy". El exquisito jugo repleto de matices huele a jazmín, ylang ylang, nardos ... Grasse y flor de azahar. Estará a la venta a partir de septiembre. 
