Acabamos de visitar el exótico y refinado apartamento de #CocoChanel en #París. Los objetos de su escritorio, los grandes murales orientalistas, el singular comedor, los almohadones del sofá que inspiraron ... espectaculares lámparas cuajadas de camelias de cristal continúan intactas en este hogar repleto de libros e inspiración  en el que #MademoiselleChanel nunca durmió. 
